import React, { Component } from 'react'

import { RadialBarChart, RadialBar, Legend } from 'recharts';

import dataAge from '../Data/dataAge'

import './dashboard.css';

import 'bootstrap/dist/css/bootstrap.min.css';



import {
  PieChart, Pie, Sector, Cell,
} from 'recharts';

const data = [
  { name: 'Group A', value: 400 },
  { name: 'Group B', value: 300 },
  { name: 'Group C', value: 300 },
  { name: 'Group D', value: 200 },
];

const COLORS = ['#0088FE', '#00C49F', '#FFBB28', '#FF8042'];

const RADIAN = Math.PI / 180;
const renderCustomizedLabel = ({
  cx, cy, midAngle, innerRadius, outerRadius, percent, index,
}) => {
   const radius = innerRadius + (outerRadius - innerRadius) * 0.5;
  const x = cx + radius * Math.cos(-midAngle * RADIAN);
  const y = cy + radius * Math.sin(-midAngle * RADIAN);

  return (
    <text x={x} y={y} fill="white" textAnchor={x > cx ? 'start' : 'end'} dominantBaseline="central">
      {`${(percent * 100).toFixed(0)}%`}
    </text>
  );
};

const style = {
  top: 0,
  left: 350,
  lineHeight: '24px',
};



class Cardcinq extends Component {

  render () {

    return (
      <div className='Cardcinq'>
        <h3>Ages des acheteurs</h3>
        <br></br>
        <center>
        <RadialBarChart width={300} height={300} cx={150} cy={150} innerRadius={20} outerRadius={140} barSize={10} data={dataAge}>
        <RadialBar minAngle={15} label={{ position: 'insideStart', fill: '#fff' }} background clockWise dataKey="uv" />

      </RadialBarChart>
        </center>

      </div>
    )
  }
}

export default Cardcinq
